import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Button from 'react-bootstrap/Button';

import { Link } from 'react-router-dom';

import '../stylesheets/Landing.css';
export default function Landing(){
    return(
        <div className="Landing">

            <header>
                <div className="header-content">
                    <h1><strong>Agricultural Resources At Your Fingertips</strong></h1>
                    <h4>Let's #ENDCOV</h4>
                    <p>I am a...</p>

                    <Link to="/login"><Button>LGU Representative</Button> </Link>

                    <Link to="/add-supply"><Button>Supplier</Button></Link>
                </div>
            </header>
            <main> 
                <div className="main-content main1">
                    <h3>What is <strong>Agri</strong>?</h3>
                    <p>This site is to help with the delivery of supplies our Local Government Units (LGU) 
                        so they can sort through all the resources and divde them fairly to their respective communities.</p>
                </div>
                <div className="main-content main2">
                    <h3></h3>
                </div>
            </main>
        </div>
    );

}
